// src/Home.js
import React from 'react';
import './styles/home.css';

const Home = () => {
  const handleLoginRedirect = () => {
    window.location.href = '/login'; // Redirigir a la página de login
  };

  return (
    <>
      <header>
        <nav>
          <h1>Bienvenido a la página principal de mascotas</h1>
          <button onClick={handleLoginRedirect} style={{ float: 'right' }}>Iniciar Sesión</button>
        </nav>
      </header>
      <button onClick={handleLoginRedirect}>Ir a Login</button> {/* Botón para redirigir */}
    </>
  );
};

export default Home;
